const e=JSON.parse('{"key":"v-6939a22c","path":"/guide/feature/search.html","title":"Search","lang":"en-US","frontmatter":{"title":"Search","icon":"search","category":["Feature"],"tag":["Feature","Search"],"summary":"The theme adds built-in support for [@vuepress/plugin-search][search] and [@vuepress/plugin-docsearch][docsearch]. Just install the plugin you want and config it, you will get a search box in navbar.\\nTo use search plugin, you need to apply it via plugins in the VuePress config file.\\n\\nNote\\nThe theme is just adding support for the above plugins, it does not bundle them. You need to install and apply them yourself.\\n\\n\\nWarning\\nDO NOT use plugins.search in theme options.\\nThe theme can ONLY apply plugins it bundles, so plugins field in theme options ONLY accepts CERTAIN plugin name.\\n\\n","head":[["meta",{"property":"og:url","content":"https://stormwangxhu.github.io/yeergubai-blog/guide/feature/search.html"}],["meta",{"property":"og:site_name","content":"vuepress-theme-hope"}],["meta",{"property":"og:title","content":"Search"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2022-08-28T10:27:12.000Z"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:locale:alternate","content":"zh-CN"}],["meta",{"property":"og:locale:alternate","content":"ru-RU"}],["meta",{"property":"article:tag","content":"Feature"}],["meta",{"property":"article:tag","content":"Search"}],["meta",{"property":"article:modified_time","content":"2022-08-28T10:27:12.000Z"}],["link",{"rel":"canonical","href":"https://vuepress-theme-hope.github.io/v2/guide/feature/search.html"}],["link",{"rel":"alternate","hreflang":"zh-cn","href":"https://stormwangxhu.github.io/yeergubai-blog/zh/guide/feature/search.html"}],["link",{"rel":"alternate","hreflang":"ru-ru","href":"https://stormwangxhu.github.io/yeergubai-blog/ru/guide/feature/search.html"}]]},"excerpt":"<p>The theme adds built-in support for [<code v-pre>@vuepress/plugin-search</code>][search] and [<code v-pre>@vuepress/plugin-docsearch</code>][docsearch]. Just install the plugin you want and config it, you will get a search box in navbar.</p>\\n<p>To use search plugin, you need to apply it via <code v-pre>plugins</code> in the <RouterLink to=\\"/cookbook/vuepress/config.html\\"><strong>VuePress config file</strong></RouterLink>.</p>\\n<div class=\\"custom-container warning\\">\\n<p class=\\"custom-container-title\\">Note</p>\\n<p>The theme is just adding support for the above plugins, it does not bundle them. You need to install and apply them yourself.</p>\\n</div>\\n<div class=\\"custom-container danger\\">\\n<p class=\\"custom-container-title\\">Warning</p>\\n<p><strong>DO NOT</strong> use <code v-pre>plugins.search</code> in theme options.</p>\\n<p>The theme can ONLY apply plugins it bundles, so <code v-pre>plugins</code> field in theme options ONLY accepts CERTAIN plugin name.</p>\\n</div>\\n","headers":[{"level":2,"title":"Use @vuepress/plugin-search","slug":"use-vuepress-plugin-search","link":"#use-vuepress-plugin-search","children":[]},{"level":2,"title":"Use @vuepress/plugin-docsearch","slug":"use-vuepress-plugin-docsearch","link":"#use-vuepress-plugin-docsearch","children":[]}],"git":{"createdTime":1645883271000,"updatedTime":1661682432000,"contributors":[{"name":"Mr.Hope","email":"mister-hope@outlook.com","commits":10},{"name":"Mr.Hope","email":"zhangbowang1998@gmail.com","commits":7}]},"readingTime":{"minutes":3.16,"words":947},"copyright":"Copyright by \\nhttps://stormwangxhu.github.io/yeergubai-blog/guide/feature/search.html","filePathRelative":"guide/feature/search.md","localizedDate":"February 26, 2022"}');export{e as data};
